        } else {
            return signature =[NSMethodSignature signatureWithObjCTypes:"@^v^c"];
        }
    } else {
        return signature;
    }
}

- (void)forwardInvocation:(NSInvocation *)anInvocation {
    if ([self respondsToSelector:[anInvocation selector]]) {
        [anInvocation invokeWithTarget:self];
